import numpy as np
import matplotlib.pyplot as plt
from keras.models import Sequential
from keras.layers import Dense
from keras.optimizers import SGD

def plot_points(features, labels, classes):
  #plot data points
  plt.plot(features[labels[:] == classes[0], 0], features[labels[:] == classes[0], 1], 'rs',
           features[labels[:] == classes[1], 0], features[labels[:] == classes[1], 1], 'g^')
  plt.axis([-1.5, 1.5, -1.5, 1.5])
  plt.xlabel("X: Feature 1")
  plt.ylabel("Y: Feature 2")
  plt.legend(["Class " + str(classes[0]), "Class " + str(classes[1])])
  plt.show()

def plot_model(features, labels, thre_params, classes):
  #plot data points
  plt.plot(features[labels[:] == classes[0], 0], features[labels[:] == classes[0], 1], 'rs',
           features[labels[:] == classes[1], 0], features[labels[:] == classes[1], 1], 'g^')
  plt.axis([-1.5, 1.5, -1.5, 1.5])
  #plot separate line
  x1 = np.linspace(-1.5, 1.5, 50)
  #aX1 + bX2 + cX0 = 0 --> x2 = -(a X1 + cX0)/b
  #thre_params[0] = w1, thre_params[1] = w2, thre_params[2] = w0
  x2 = -(thre_params[0]* x1 + thre_params[2])/thre_params[1] 
  plt.plot(x1, x2, '-r')
  plt.xlabel("X: Feature 1")
  plt.ylabel("Y: Feature 2")
  plt.legend(["Class " + str(classes[0]), "Class " + str(classes[1])])
  #plt.show()

