import numpy as np
import matplotlib.pyplot as plt
from keras.models import Sequential
from keras.layers import Dense
from keras.optimizers import SGD
from keras.datasets import mnist
from keras.utils import to_categorical
from sklearn.metrics import accuracy_score, confusion_matrix, recall_score

def feat_extract(images):
  width = images.shape[1]
  height = images.shape[2]
  features = np.zeros((images.shape[0], 4))
  #quadrant 0 
  features_temp = np.sum(images[:, 0:int(width/2), 0:int(height/2)], axis = 2)
  features[:, 0] = np.sum(features_temp, axis = 1) / (width * height / 4)
  #quadrant 1
  features_temp = np.sum(images[:, 0:int(width/2), int(height/2):], axis = 2)
  features[:, 1] = np.sum(features_temp, axis = 1) / (width * height / 4)
  #quadrant 2
  features_temp = np.sum(images[:, int(width/2):, 0:int(height/2)], axis = 2)
  features[:, 2] = np.sum(features_temp, axis = 1) / (width * height / 4)
  #quadrant 3
  features_temp = np.sum(images[:, int(width/2):, int(height/2):], axis = 2)
  features[:, 3] = np.sum(features_temp, axis = 1) / (width * height / 4)
  return features

def feat_plot(features, labels, classes):
  for class_i in classes:
    plt.plot(features[labels[:] == classes[class_i], 0], 
             features[labels[:] == classes[class_i], 1],
             'o', markersize = 15)
    plt.xlabel("Feature 1")
    plt.ylabel("Feature 2")
    plt.legend(["Class " + str(classes[class_i]) for class_i in classes])
    plt.show()

#plot the training accuracy and loss
def plot_curve(accuracy_train, loss_train):
  epochs = np.arange(loss_train.shape[0])
  plt.subplot(1, 2, 1)
  plt.plot(epochs, accuracy_train)
  plt.xlabel("Epochs")
  plt.ylabel("Accuracy")
  plt.title("Training Accuracy")

  plt.subplot(1, 2, 2)
  plt.plot(epochs, loss_train)
  plt.xlabel("Epochs")
  plt.ylabel("Binary Crossentropy Loss")
  plt.title("Training Loss")
  plt.show()  

#load dataset and select only zeros and ones
classes = [0, 1, 2] #3 digit classification
(x_train, y_train), (x_test, y_test) = mnist.load_data()
x_train = x_train[np.logical_or.reduce((y_train == 0, y_train == 1, y_train == 2)), :, :]
y_train = y_train[np.logical_or.reduce((y_train == 0, y_train == 1, y_train == 2))] 
x_test = x_test[np.logical_or.reduce((y_test == 0, y_test == 1, y_test == 2)), :, :]
y_test = y_test[np.logical_or.reduce((y_test == 0, y_test == 1, y_test == 2))]

#shuffle training set
num_train_img = x_train.shape[0]
train_ind = np.arange(0, num_train_img)
train_ind_shuffle = np.random.permutation(train_ind)
x_train = x_train[train_ind_shuffle, :, :]
y_train = y_train[train_ind_shuffle]

#select first 20% to be validation data, remaining 80% is training
x_valid = x_train[0:int(.2 * num_train_img), :, :]
y_valid = y_train[0:int(.2 * num_train_img)]
x_train = x_train[int(.2 * num_train_img):, :, :]
y_train = y_train[int(.2 * num_train_img):]

#extract features
feat_train = feat_extract(x_train)
feat_valid = feat_extract(x_valid)
feat_test = feat_extract(x_test) #not needed

#convert labels to categorical arrays
y_train_c = to_categorical(y_train, len(classes))
y_valid_c = to_categorical(y_valid, len(classes))
y_test_c = to_categorical(y_test, len(classes))

#define model
model_012 = Sequential(name="digits_012")
model_012.add(Dense(input_dim = 4, units = 100, activation="tanh", name="hidden_layer_1"))
model_012.add(Dense(units = len(classes), activation="softmax", name="output_layer"))
model_012.summary()

#compile network
model_012.compile(loss = "categorical_crossentropy",
                  optimizer = SGD(lr = 0.0001),
                  metrics = ["accuracy"])

#fit the model
history = model_012.fit(np.array(feat_train), np.array(y_train_c),
                        batch_size = 16,
                        epochs = 50,
                        verbose = 1)
accuracy_curve = np.array(history.history["accuracy"])
loss_curve = np.array(history.history["loss"])
plot_curve(accuracy_curve, loss_curve)

#model evaluation
scores = model_012.evaluate(feat_train, y_train_c)
print("Training Loss: " + str(scores[0]))
print("Training Accuracy: " + str(scores[1]))

score2 = model_012.evaluate(feat_valid, y_valid_c)
print("Validation Loss: " + str(score2[0]))
print("Validation Accuracy: " + str(score2[1]))

score3 = model_012.evaluate(feat_test, y_test_c)
print("Testing Loss: " + str(score3[0]))
print("Testing Accuracy: " + str(score3[1]))

